import myPortait from '../assets/martin-hodsman-2020.jpg';

export const info = [
    {
        id: 1,
        title: "Hello, it's me!",
        content: 'I am Martin and I love to learn. For some time, coding is my passion. This is my latest project. I completed it to gain experience and to entertain you. The first point I achieved for sure, the latter point depends on you.',
        image: myPortait,
        alt: 'Martin Hodsman (2020)'
    },
    {
        id: 2,
        title: "That's my tech stack!",
        techStack: [
            {
                title: 'React',
                level: 'Very good'
            },
            {
                title: 'JavaScript',
                level: 'Very good'
            },
            {
                title: 'CSS/SCSS/SASS',
                level: 'Very good'
            }
        ]
    },
    {
        id: 3,
        title: 'How did I build this app?'
    },
    {
        id: 4,
        title: 'What was my biggest challenge?'
    },
    {
        id: 5,
        title: 'What was my biggest learning?'
    },
    {
        id: 6,
        title: "Let's get connected!",
        content: "Just send me a request via LinkedIn or Xing and let's communicate about coding, projects and the world."
    }
];
